  useEffect(() => axios.get("https://jsonplaceholder.typicode.com/posts").then((res)=>{
      setPost(res.data)
      console.log(res.data);}) , []);


  return (
<div>
  {post.map((post)=> <Post title={post.title} body={post.body}/>)}
</div>    
  );
}

export default App;
